import StartUpIcon from '../images/appleTalk.png'

export default function Prenav() {
    return (
        <div className='border-black border-t-2 mt-2'>
        <img className='inline-block mr-3' src={StartUpIcon} />
        <h6 className='text-xs italic font-display py-2 md:py-3 inline-block'>Just trying to throw it back a back</h6>

        </div>
    );
}
